import React from "react";

<link
  rel="stylesheet"
  href="https://fonts.googleapis.com/css?family=Lato:400,700&display=swap"
/>;
function App() {
  return (
    <>
      <div className="font-lato">dasdsadasdasdasdd</div>
      <div>dasdasasddas</div>
      <div className="font-olivia">This text uses the Olivia font.</div>
    </>
  );
}

export default App;

